script: |
  super -f tsv -I q3326.sql | sort > q3326.out

vector: true

inputs:
  - name: q3326.sql
    data: |
      SELECT 90 * 49 AS col2 FROM tab2 AS cor0 GROUP BY cor0.col1, cor0.col2, cor0.col0, cor0.col1;
  - name: tab2

outputs:
  - name: q3326.out
    data: |
      4410
      4410
      4410
